import React from "react";
import PatientNavbar from "../../components/PatientNavbar";
import PatientSidebar from "../../components/PatientSidebar";
import VideoCallButton from "../../components/VideoCallButton";
import AppointmentCard from "../../components/AppointmentCard";
import HealthSevaCard from "../../components/HealthSevaCard";
import MedicineOrderCard from "../../components/MedicineOrderCard";
import InsuranceSchemes from "../../components/InsuranceSchemes";
import { Link } from "react-router-dom";
import "../../styles/PatientDashboard.css"; // Import the new styles


const PatientDashboard = () => {
  return (
    <div className="flex h-screen">
      <PatientSidebar />  {/* Updated to use PatientSidebar */}
      <div className="flex-1 flex flex-col">
        <PatientNavbar />
        <div className="p-6">
          <h1 className="text-2xl font-bold mb-4">Welcome to Your Dashboard</h1>

          {/* Navigation Options */}
          <div className="grid grid-cols-2 gap-4">
            <Link to="/patient-dashboard/appointments">
              <AppointmentCard />
            </Link>
            <Link to="/patient-dashboard/medical-history">
              <MedicineOrderCard />
            </Link>
            <VideoCallButton />
            <Link to="/health-seva">
              <HealthSevaCard />
            </Link>
            <Link to="/insurance-schemes">
              <InsuranceSchemes />
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PatientDashboard;
